import { Routes, Route } from "react-router-dom";
import About from "./About";
const Button = ({ buttonText }) => {
    return (
        <button
            className={buttonText}
            type="submit"
            onClick={(e) => {
                <Route path="/about" element={<About />} />;
            }}
        >
            {buttonText}
        </button>
    );
};

export default Button;
